def hashString(plaintext, salt=None):
    """
    Hashing algorithm used by Pythinux.
    Args:
        plaintext: a string.
        salt: an optional salt, usually a bytes-like object. If none is provided, a random one is generated.
    Returns:
        salted_hash: The final hash. The last 16 characters is the salt, required to verify the hash.
    The verifyHash function is used to authenticate hashes.
    """
    if salt is None:
        salt = os.urandom(16).hex()

    salted_string = f"{plaintext}{salt}"
    hashed_string = hashlib.sha256(salted_string.encode()).hexdigest()
    salted_hash = f"{hashed_string}{salt}"
    return salted_hash


class User(Base):
    """
    User class used by Pythinux.
    See __init__() for how to create User objects properly.
    """

    def __init__(self, username, password=hashString(""), lvl=1):
        """
        Constructor for User class.
        Args:
            username: string, the username for the user.
            password: string passed through hashString() (Note: you MUST pass it through hashString().
                If no password is given, the password is blank. (the hash obviously still exists. pydoc represents the output of hashString("") as the default password.
            lvl: integer represenging the user's level.
                0: guest, has very limited access to programs.
                1: user, can access system_low programs.
                2: root, can access all programs.
                3: god, can access system_high programs. Generally not used.
                Other values: invalid user, causes bugs.
        """
        super().__init__()
        self.username = username
        self.password = hashString(password)
        self.lvl = lvl

    def check(self, username, password=hashString("")):
        """
        Function for checking whether a User class and passed details match.
        Args:
            username: string
            password: string
        Returns:
            bool depending on whether or not the supplied details match up with the User object's properties.
        """
        if username == self.username and verifyHash(password, self.password):
            return True
        return False

    def admin(self):
        """
        Returns whether or not the user's level is 2 or higher, indicating a root user.
        """
        return self.lvl > 1

    def god(self):
        """
        Returns whether or not the user's level is 3 or higher, indicating a god user.
        """
        return self.lvl > 2

    def USERTYPE(self):
        """
        Returns a string of the user's user type based on the stored value.
        Level 0 returns "guest", lv1 returns "user", 2 "root", 3 "god", and other values
        return "#INVALID".
        """
        if self.lvl == 0:
            return "guest"
        elif self.lvl == 1:
            return "user"
        elif self.lvl == 2:
            return "root"
        elif self.lvl == 3:
            return "god"
        else:
            return "#INVALID"


def copy(obj):
    """
    See python's copy.deepcopy(). It's the same thing.
    """
    try:
        return cp.deepcopy(obj)
    except:
        try:
            return cp.copy(obj)
        except:
            return obj


